import React from 'react';
import { useState, useEffect } from 'react';
import '../../src/App.css';
export const Feed = () => {
    const now = new Date().toLocaleTimeString().slice(0,7);
    const [state, setState] = useState(now);
    
    function changetime(){
        setState(now);
    }
    return (
        <div className='feed'>
        <h2 onChange={changetime}>{state}</h2>
        <button className='button'>Time</button>
        </div>
    );
}
export default Feed;
